def count_vs_cap(cap_list, data1, data2, data3, data4, data5, data6):
    #import custom font
    font_path = './font/linux_libertine/LinLibertine_RB.ttf'  # the location of the font file
    my_font = font_manager.FontProperties(fname=font_path, size=18)  # get the font based on the font_path, set font size

    font_path2 = './font/linux_libertine/LinLibertine_R.ttf'  # the location of the font file
    my_font2 = font_manager.FontProperties(fname=font_path2, size=20)  # get the font based on the font_path, set font size

    max_data1_index = data1.index(max(data1))
    max_data2_index = data2.index(max(data2))
    max_data3_index = data3.index(max(data3))
    max_data4_index = data4.index(max(data4))
    max_data5_index = data5.index(max(data5))
    max_data6_index = data6.index(max(data6))
    fig, axs = plt.subplots(2, 1, figsize=(12, 4), sharex=True)
    axs[0].set_xscale('log')
    axs[0].plot(cap_list, data1, color="blue", label="Apollo4", alpha=1)
    axs[0].plot(cap_list, data2, color="green", label="MSP430", alpha=1)
    axs[0].plot(cap_list, data3, color="orange", label="MARS", alpha=1)
    axs[0].set_yscale('log')
    axs[0].plot(cap_list[max_data1_index], data1[max_data1_index],  'ro', color='blue')
    axs[0].plot(cap_list[max_data2_index], data2[max_data2_index],  'ro', color='green')
    axs[0].plot(cap_list[max_data3_index], data3[max_data3_index],  'ro', color='orange')

    axs[1].set_xscale('log')
    axs[1].plot(cap_list, data4, color="blue", label="Apollo4", alpha=1)
    axs[1].plot(cap_list, data5, color="green", label="MSP430", alpha=1)
    axs[1].plot(cap_list, data6, color="orange", label="MARS", alpha=1)
    axs[1].set_yscale('log')
    axs[1].plot(cap_list[max_data4_index], data4[max_data4_index],  'ro', color='blue')
    axs[1].plot(cap_list[max_data5_index], data5[max_data5_index],  'ro', color='green')
    axs[1].plot(cap_list[max_data6_index], data6[max_data6_index],  'ro', color='orange')
    
    # axs.flat[0].set_ylabel("# of Operations", fontproperties=my_font2)
    axs.flat[0].set_title("v0", fontproperties=my_font)
    # axs.flat[1].set_ylabel("# of Operations", fontproperties=my_font2)
    axs.flat[1].set_title("v3", fontproperties=my_font)
    plt.xlabel("Capacitance (F)", fontproperties=my_font, size=22)
    # plt.ylabel("Number of Operations",  fontproperties=my_font2)
    fig.text(0.06, 0.5, 'Number of Operations', va='center', rotation='vertical', fontproperties=my_font, size=22)
    

    #set font type of tickmarks
    for label in axs[0].get_xticklabels():
        label.set_fontproperties(my_font2)
    for label in axs[0].get_yticklabels():
        label.set_fontproperties(my_font2)

    #set font type of tickmarks
    for label in axs[1].get_xticklabels():
        label.set_fontproperties(my_font2)
    for label in axs[1].get_yticklabels():
        label.set_fontproperties(my_font2)

    # Put a legend below current axis
    plt.legend(loc='upper center', bbox_to_anchor=(0.5, 2.63),
          fancybox=True, ncol=4, prop=my_font, frameon=False)
    plt.show()

